import './assets/css/app.css';
import Video from './components/Video.js';
import Watermark from './components/Watermark';

function App() {
  return (
    <div className="app">
      <Watermark />
      <div className="app__videos">
        <Video/>
        <Video/>
        <Video/>
        <Video/>
      </div>
    </div>
  );
}

export default App;
